      out.write("function isSpecificCouponExpire(){\r\n");
      out.write("\t//优先级判断：站腾网 SEO>网站定制>云客网 SEO；\r\n");
      out.write("\tvar ztType = 95;\r\n");
      out.write("\tvar webSiteCustomType = 149;\r\n");
