      out.write("\tvar webSiteCustom = {type:webSiteCustomType,expireTime:undefined,price:undefined,id:undefined};//网站定制现金券\r\n");
      out.write("\tvar ykSeo = {type:ykType,expireTime:undefined,price:undefined,id:undefined};//云客网SEO现金券\r\n");
      out.write("\tvar productArr = [ztSeo,webSiteCustom,ykSeo];\r\n");
      out.write("\t\r\n");
      out.write("\tvar productMap = {95:0,149:1,142:2};\r\n");
      out.write("\tvar hasSpecificCoupon = false;\r\n");
      out.write("\t$.ajax({\r\n");
      out.write("\t\ttype: \"post\",\r\n");
      out.write("\t\tasync: false,\r\n");
      out.write("\t\tdata:{cmd:\"getCouponInfo\",types: $.toJSON(couponType)},\r\n");
      out.write("\t\turl: \"/ajax/corpGroupBuy_h.jsp\",\r\n");
      out.write("\t\terror: function(){\r\n");
      out.write("\t\t\tFai.ing(\"服务繁忙，请稍候重试\",false);\r\n");
      out.write("\t\t},\r\n");
      out.write("\t\tsuccess: function(result){\r\n");
      out.write("\t\t\tvar result = $.parseJSON(result);\r\n");
      out.write("\t\t\tif(result.success){\r\n");
      out.write("\t\t\tvar coupons = $.parseJSON(result.data);\r\n");
      out.write("\t\t\t\t$.each(coupons, function(index,coupon) {\r\n");
      out.write("\t\t\t\t\tif(coupon.status==0){\r\n");
      out.write("\t\t\t\t\t\tvar couponType = coupon.type;\r\n");
      out.write("\t\t\t\t\t\tvar index = productMap[couponType];\r\n");
      out.write("\t\t\t\t\t\tif(index!=undefined){\r\n");
      out.write("\t\t\t\t\t\t\tproductArr[index].expireTime = new Date(coupon.expireTime);\r\n");
      out.write("\t\t\t\t\t\t\tproductArr[index].price = coupon.price;\r\n");
      out.write("\t\t\t\t\t\t\tproductArr[index].id = coupon.id;\r\n");
      out.write("\t\t\t\t\t\t\thasSpecificCoupon = true;\r\n");
      out.write("\t\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t\t}\r\n");
      out.write("\t\t\t\t});\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t}\r\n");
      out.write("\t});\r\n");
      out.write("\t\r\n");
      out.write("\tvar hasCouponExpired = false;\r\n");
      out.write("\tif(hasSpecificCoupon){\r\n");
      out.write("\t\t//最近七天的区间\r\n");
      out.write("\t\tvar today = new Date();\r\n");
      out.write("\t\tvar expireArr = new Array();\r\n");
