      out.write("\t\t\t\taWeekAgo.setDate(expireTime.getDate()-7);\r\n");
      out.write("\t\t\t\tif(aWeekAgo<=today&&today<=expireTime){\r\n");
      out.write("\t\t\t\t\thasCouponExpired = true;\r\n");
      out.write("\t\t\t\t}\r\n");
      out.write("\t\t\t}\r\n");
      out.write("\t\t});\r\n");
      out.write("\t}\r\n");
      out.write("\t\r\n");
      out.write("\treturn hasCouponExpired;\r\n");
      out.write("}\r\n");
